import React from 'react';
import './TableProducts.scss'
import { useNavigate } from 'react-router-dom';



const TableRecomendations = ({products})=> {
    const navigate = useNavigate();


    return(
            <div className="products-table">
            <table>
                <thead>
                <tr>
                    <th>Nombre</th>
                    <th>Marca</th>
                    <th>Categor√≠a</th>
                    <th>Ventas</th>
                    <th>Accion</th>
                </tr>
                </thead>
                {products.map((products, index) => (
                    <tr key={products.product.id}>
                    <td>{product.product.nombre}</td>
                    <td>{product.product.marca.nombre}</td>
                    <td>{product.product.categoria.nombre}</td>
                    <td>{product.ventaCount}</td>
                    <td><button className="movements-btn" >Crear promocion</button></td>
                    </tr>
                ))}
            </table>
            </div>
        )
}
export default TableRecomendations;
